import Navbar from "./Navbar";
import { BrowserRouter as Router, Route } from "react-router-dom";
import React from 'react';
import ReactDOM from 'react-dom';
import { SocialIcon } from 'react-social-icons';
ReactDOM.render(<SocialIcon url="https://twitter.com/jaketrent" />, document.body);

const App = () => {

  return(
      <Router>
          <div className="one">
          <Navbar />
            <p className = "name"> hi, i'm nikki! </p>
            <div className = "ellipse"> </div>
            <div className = "box-container"> <div className="box"> <SocialIcon url="https://www.linkedin.com/in/nikkisuzani/"></SocialIcon></div> <div className="box"></div> <div className="box"></div> </div>
          </div>

      </Router>
  );
}
export default App;
